   return ( <div className='container'>
              <h1>{count}</h1>  
              <button onClick={() => setCount(count + 1)}>
                   Incrémenter
              </button>
              <button onClick={() => setCount(count - 1)}>
                   décrémenter
              </button>
              <ClientList/>
            </div>)

}

export default Home;
